import { Component, OnInit } from '@angular/core';
import { YouTubeService } from 'src/app/services/you-tube-service/you-tube.service';

@Component({
  selector: 'app-top-list',
  templateUrl: './top-list.component.html',
  styleUrls: ['./top-list.component.css'],
})
export class TopListComponent implements OnInit {
  trendingVideos: any[] = [];
  constructor(private youTubeService: YouTubeService) {}
  ngOnInit(): void {
    this.getTrendingVideos();
  }

  getTrendingVideos() {
    this.youTubeService.getTrendingVideos().subscribe((response: any) => {
      this.trendingVideos = response.items;
    });
  }
}
<div class="topList">
    <ul class="list">
        <li class="topListHeading">☆TOP LIST☆</li>
        <ng-container *ngFor="let video of trendingVideos; let i = index">
            <li *ngIf="i < 20">
                <span class="numberSpan">
                    {{ i + 1 }}#
                </span>

                {{ video.snippet.title }}
                <br><br>
            </li>
        </ng-container>
        <li class="topListHeading">☆TOP LIST☆</li>
        <ng-container *ngFor="let video of trendingVideos; let i = index">
            <li *ngIf="i < 20">
                <span class="numberSpan">
                    {{ i + 1 }}#
                </span>

                {{ video.snippet.title }}
                <br><br>
            </li>
        </ng-container>
        <li class="topListHeading">☆TOP LIST☆</li>
        <ng-container *ngFor="let video of trendingVideos; let i = index">
            <li *ngIf="i < 20">
                <span class="numberSpan">
                    {{ i + 1 }}#
                </span>

                {{ video.snippet.title }}
                <br><br>
            </li>
        </ng-container>
        <li class="topListHeading">☆TOP LIST☆</li>
        <ng-container *ngFor="let video of trendingVideos; let i = index">
            <li *ngIf="i < 20">
                <span class="numberSpan">
                    {{ i + 1 }}#
                </span>

                {{ video.snippet.title }}
                <br><br>
            </li>
        </ng-container>
    </ul>
</div>
